 06:50:29','2020-05-07 06:50:29'),(45,'Other','other',0,0,'Do you have a demanding taste and sophisticated outlook on life? Didnt you like any of the categories on fb.zone? Then pay attention to the Other category, which contains the most unusual Facebook topics that do not lend themselves to any classification. Already then you will 100% find something that you like, and you can use it.\nWhy change the design of a social network at all? For example, to diversify your virtual life and bring a little extravagance and personality to it. While others will throw a tired look at the bored lavender color of Facebook, you can enjoy the unique background and design of the buttons on your page. And if you wish, you have the opportunity to change the subject anytime you want. Perhaps your mood will change, and you decide to try out options from other categories. You are always welcome, because it can be done in a couple of seconds online.\nTo modify the look of the social network and upload new Facebook wallpapers, you will need the Themes for Facebook browser extension. It changes the design in one click, but only after adding themes from the catalog to it. Add wallpapers from the category you are currently in, activate them and enjoy the result!','There are so many different things in the world','other.webp','2020-05-07 10:20:12','2020-05-07 10:20:12'),(46,'Landscapes','landscapes',0,0,'Picturesque landscapes are what the soul rejoices from and the heart sings. Have you ever got up in the middle of a poppy field and marveled at its red immensity? Looking at the green plains from the top of a high mountain? If not, then you are still ahead, but for now you can do the same, only virtually. To do this, install Facebook themes dedicated to natural landscapes, which are captured by the best photographers in the world.\nHow beautiful the spring forest with the crystal clear stream flowing through it! How magnificent Niagara Falls and the delightfully Red Sea with its inhabitants! How severe and, at the same time, the Sahara desert is charming! You can make sure of all this with the help of the Themes for Facebook extension, whose task is to replace the standard Facebook color with unique wallpapers.\nOnce you install the extension, add themes from the Landscapes category to it. Then just click on any of the design options and activate it for the social network. If you like the changes, leave it so, if not, try other Facebook wallpapers, because they are available to everyone. Change the design of your favorite social network as you wish!','The scope of the landscape for lovers to contemplate the beauty','landscapes.webp','2020-05-07 10:29:26','2020-05-07 10:29:26'),(47,'Lifestyle','lifestyle',0,0,'Each person has his own lifestyle. Someone prefers sports, while someone likes to lie on the couch watching TV. Some people think that you need to work day and night, while others adhere to the point of view that all life flies at work and this is bad. The fb.zone website has Facebook themes for most life styles. Most likely, you will find wallpapers that match your philosophy and can apply them in 1 click.\nLifestyle is a collection of habits that form over a long period of time. For some, the habit is to get up early and exercise in the morning, for others, to smoke a cigar after a working day with a glass of wine. Any style has its advantages and disadvantages, but today we are not talking about that. It\'s about the color of Facebook, which can be replaced with a more interesting design.\nTo modify the appearance of the buttons and change the background of the social network, first install the extension Themes for Facebook. Check out the themes in the Lifestyle category and add the ones you like. Then activate any of the Facebook wallpapers, and on this your mission is completed! Now you will see a picture that fits your lifestyle, not the default colors.','Staying yourself is the easiest and most dignified way of life','lifestyle.webp','2020-