INSERT INTO `themes` VALUES (1,'Halo','Halo is a first-person shooter video game series developed by Bungie and 343 Industries, and published by Xbox Game Studios. The series centers around an interstellar war between humanity and an alliance of aliens known as the Covenant. The main protagonist of the series is Master Chief, a genetically enhanced supersoldier, who battles the Covenant and other threats to humanity. The series has been widely praised for its story, gameplay, and multiplayer features. It is considered one of the most successful and influential video game franchises of all time.',6,0,'{\"header_color\":\"#2f2c28\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#03132880\",\"lm_text_color\":\"#c6f0ea\",\"lm_hover_color\":\"#240125\",\"lm_hover_text_color\":\"\",\"font_name\":\"Moulpali\",\"top_bg\":\"#414c6e\",\"top_text\":\"#9e9faa\"}','games/themes/11-halo_bg.webp','','games/themes/11-halo.webp','games/themes/11-halo_screenshot.webp',528,'[0,0,0,0,1]',5,'2024-09-16 13:09:23','2023-01-24 15:10:36','2024-09-16 09:09:23'),(2,'Aurora Borealis','The Aurora Borealis, also known as the Northern Lights, is a natural light display in the Earth\'s sky, predominantly seen in the high-latitude regions of the Arctic and Antarctic. The lights are caused by the collision of charged particles with atoms in the Earth\'s atmosphere. The color of the aurora is determined by the type of gas particles that are colliding. The most common color is a pale yellowish-green, but the aurora can also appear red, yellow, green, blue, or purple. The aurora is typically visible during the night and can be seen in many areas, including Alaska, Canada, Northern Europe, and Russia.',12,0,'{\"header_color\":\"#d8eace\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#bed5d380\",\"lm_text_color\":\"#151333\",\"lm_hover_color\":\"#c4dcc3\",\"lm_hover_text_color\":\"\",\"font_name\":\"Cantarell\",\"top_bg\":\"#c7bffb\",\"top_text\":\"#2e0c35\"}','nature/themes/614-aurora_borealis_bg.webp','','nature/themes/614-aurora_borealis.webp','nature/themes/614-aurora_borealis_screenshot.webp',430,'[0,0,0,0,1]',5,'2024-09-16 16:20:42','2023-01-24 16:35:05','2024-09-16 12:20:42'),(3,'Abstract Fractal Purple and Blue','Purple-blue video wallpaper for Facebook is the perfect way to make your profile stand out. The dynamic movement and blend of hues in purple and blue create a mesmerizing and calming atmosphere, making it perfect for your Facebook profile. With a purple-blue video wallpaper, you can give your profile a modern and unique look that reflects your personal style. Whether you are looking to make a statement or simply want to add a touch of personality, a purple-blue video wallpaper is sure to make your profile stand out among others. So why settle for a boring static image when you can have a dynamic and visually stunning purple-blue video wallpaper for your Facebook profile?',8,1,'{\"header_color\":\"#f9cddc\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#dbd9fc80\",\"lm_text_color\":\"#0e3037\",\"lm_hover_color\":\"#dee7e8\",\"lm_hover_text_color\":\"\",\"font_name\":\"Noto Serif Bengali\",\"top_bg\":\"#022034\",\"top_text\":\"#d0c1d1\"}','abstract/themes/902-abstract_fractal_purple_and_blue_bg.mp4','abstract/themes/902-abstract_fractal_purple_and_blue_bg_thumb.webm','abstract/themes/902-abstract_fractal_purple_and_blue.webp','abstract/themes/902-abstract_fractal_purple_and_blue_screenshot.webp',333,'[0,0,0,0,1]',5,'2024-09-08 14:25:42','2023-01-24 17:30:28','2024-09-08 14:25:42'),(4,'3D hexagonal background','A 3D hexagonal background can add a unique and visually interesting touch to your Facebook profile. The hexagonal shape creates a honeycomb-like pattern that can be customized with different colors and textures. You\'ll have a unique and eye-catching profile.',23,0,'{\"header_color\":\"#353139\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#06181480\",\"lm_text_color\":\"#c7cdc6\",\"lm_hover_color\":\"#0b1817\",\"lm_hover_text_color\":\"\",\"font_name\":\"Proza Libre\",\"top_bg\":\"#cfc5db\",\"top_text\":\"#28363b\"}','3d_graphics/themes/823-3d_hexagonal_background_bg.webp','','3d_graphics/themes/823-3d_hexagonal_background.webp','3d_graphics/themes/823-3d_hexagonal_background_screenshot.webp',448,'[0,0,0,0,0]',0,'2024-09-14 20:59:26','2023-01-24 18:14:24','2024-09-14 16:59:26'),(5,'British flag','The British flag, also known as the Union Jack, is a symbol of the United Kingdom and its history. The flag is made up of three crosses: the red St. George\'s Cross, which represents England; the white St. Andrew\'s Cross, which represents Scotland; and the red St. Patrick\'s Cross, which represents Ireland. The combination of these three crosses creates a unique and recognizable flag that is steeped in history and tradition. The flag was first officially adopted in 1801, and since then it has been flown on ships, buildings, and other important locations throughout the UK. It has also been used as a symbol of unity and national pride. The flag is a powerful symbol that represents the diversity and history of the United Kingdom, and it continues to be an important part of the country\'s national identity.',29,1,'{\"header_color\":\"#d9c4d2\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#d5cecc80\",\"lm_text_color\":\"#3d1223\",\"lm_hover_color\":\"#e8e0c4\",\"lm_hover_text_color\":\"\",\"font_name\":\"Gulzar\",\"top_bg\":\"#dad7e1\",\"top_text\":\"#2a262b\"}','flags/themes/819-british_flag_bg.mp4','flags/themes/819-british_flag_bg_thumb.webm','flags/themes/819-british_flag.webp','flags/themes/819-british_flag_screenshot.webp',149,'[0,0,0,0,0]',0,'2024-09-06 07:27:26','2023-01-24 18:34:02','2024-09-06 07:27:26'),(6,'Morning mountains','Morning mountains are a breathtaking sight to behold. The sun rises over the peaks, casting a warm glow over the landscape and illuminating the valleys below. The mist that often clings to the mountains in the early morning hours adds a mystical quality to the scene. The fresh air and tranquility of the mountains make it a perfect place to start the day. Whether you\'re a hiker, a photographer, or just someone looking to take in the natural beauty of the world, morning mountains are a must-see. The light and shadows of the morning will create a unique play of colors, shapes and textures that will give a different look to the same mountain range, every morning. The quietness and peacefulness of the morning will make you feel as if you\'re the only person in the world and that you have the whole mountain to yourself.',46,0,'{\"header_color\":\"#d9fbfe\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#c6eef680\",\"lm_text_color\":\"#05092a\",\"lm_hover_color\":\"#dfd8e4\",\"lm_hover_text_color\":\"\",\"font_name\":\"Hanuman\",\"top_bg\":\"#cbe4f3\",\"top_text\":\"#0c3122\"}','landscapes/themes/639-morning_mountains_bg.webp','','landscapes/themes/639-morning_mountains.webp','landscapes/themes/639-morning_mountains_screenshot.webp',310,'[0,0,0,0,0]',0,'2024-09-14 23:14:10','2023-01-24 18:52:00','2024-09-14 19:14:10'),(7,'Wood texture','Wood texture refers to the visual and tactile qualities of wood surfaces. It is influenced by factors such as the species of wood, growth patterns, and the way in which the wood has been finished. Some woods have a smooth, even texture, while others have a more rough and uneven texture. The texture of a piece of wood can also be affected by the direction of the grain, which can be straight, wavy, or curly. The texture of wood can be used to enhance the aesthetic appeal of a piece of furniture or architectural element, or to create a sense of warmth and naturalness in a room.',22,0,'{\"header_color\":\"#312a0f\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#231e2480\",\"lm_text_color\":\"#fbf1df\",\"lm_hover_color\":\"#0e1e36\",\"lm_hover_text_color\":\"\",\"font_name\":\"Scope One\",\"top_bg\":\"#9f9c9f\",\"top_text\":\"#595a4e\"}','textures/themes/415-wood_texture_bg.webp','','textures/themes/415-wood_texture.webp','textures/themes/415-wood_texture_screenshot.webp',170,'[0,0,0,0,0]',0,'2024-09-09 07:59:51','2023-01-25 13:51:11','2024-09-09 07:59:51'),(8,'Flying triangles','Video backgrounds can add a dynamic and visually interesting element to a Facebook page. One unique idea for a video background is using flying triangles. These triangles can be in different colors, sizes, and speeds to create a mesmerizing and abstract effect. The video can also have a subtle animation of the triangles changing direction, rotating or overlapping each other, to create a sense of movement and depth. Using a video background with flying triangles can give a modern and tech-savvy feel to a Facebook page, making it stand out from the typical static image backgrounds.',1,1,'{\"header_color\":\"#233d3a\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#1c1c1480\",\"lm_text_color\":\"#d7cee5\",\"lm_hover_color\":\"#082f07\",\"lm_hover_text_color\":\"\",\"font_name\":\"Salsa\",\"top_bg\":\"#232018\",\"top_text\":\"#e4e5ee\"}','travel/themes/88-flying_triangles_bg.mp4','travel/themes/88-flying_triangles_bg_thumb.webm','travel/themes/88-flying_triangles.webp','travel/themes/88-flying_triangles_screenshot.webp',312,'[0,0,1,0,0]',3,'2024-09-18 21:02:18','2023-01-25 13:57:38','2024-09-18 17:02:18'),(9,'Astronaut in a space','An astronaut in space is a creative and unique idea for a background on a Facebook page. The background can feature an astronaut floating in a space suit with a visor reflecting the stars and galaxies, this can give an impression of a vast and mysterious space. The background can also show the astronaut doing different activities like taking a spacewalk, holding a flag, or gazing through a telescope. This background can create an interesting and visually appealing look that can grab people\'s attention, making the Facebook page stand out. Additionally, it can be a great way to incorporate brand\'s unique identity and make the page more visually engaging for visitors. The use of astronaut imagery can be particularly effective for companies or organizations related to space, technology, or exploration.',7,0,'{\"header_color\":\"#e7ecd6\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#c3c0db80\",\"lm_text_color\":\"#35201b\",\"lm_hover_color\":\"#dcf0d3\",\"lm_hover_text_color\":\"\",\"font_name\":\"Changa\",\"top_bg\":\"#948ea0\",\"top_text\":\"#5a4378\"}','space/themes/761-astronaut_in_a_space_bg.webp','','space/themes/761-astronaut_in_a_space.webp','space/themes/761-astronaut_in_a_space_screenshot.webp',438,'[0,0,0,0,0]',0,'2024-09-19 03:06:11','2023-01-25 14:02:30','2024-09-18 23:06:11'),(10,'McLaren Senna GTR','A McLaren Senna GTR can make an excellent background for a Facebook page. The background can feature the car in motion, with its sleek and aerodynamic design on full display. The car can be shown on a race track, surrounded by the blurred background, which gives an impression of speed and motion. The background can also show the car in different angles, such as a front view, back view, or a side view, to showcase its detailed design. This background can create an interesting and visually appealing look that can grab people\'s attention, making the Facebook page stand out. Additionally, it can be a great way to incorporate brand\'s unique identity and make the page more visually engaging for visitors. The use of a McLaren Senna GTR can be particularly effective for companies or organizations related to car racing, luxury cars, or high-performance vehicles.',10,0,'{\"header_color\":\"#313633\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#18053e80\",\"lm_text_color\":\"#dfd7f4\",\"lm_hover_color\":\"#3e1503\",\"lm_hover_text_color\":\"\",\"font_name\":\"K2D\",\"top_bg\":\"#14221f\",\"top_text\":\"#c6c6d3\"}','cars_and_motorcycles/themes/936-mclaren_senna_gtr_bg.webp','','cars_and_motorcycles/themes/936-mclaren_senna_gtr.webp','cars_and_motorcycles/themes/936-mclaren_senna_gtr_screenshot.webp',520,'[0,0,0,0,1]',5,'2024-09-16 10:42:01','2023-01-25 14:21:21','2024-09-16 06:42:01'),(11,'Abstract waves','An abstract wave video background can add a dynamic and visually interesting element to a Facebook page. The video can feature different shades of colors, creating an ethereal and mesmerizing effect. The waves can be of different sizes and can move in different directions, creating a sense of movement and depth. The video can also include subtle animations, such as the waves changing color or shape, to keep the background interesting and engaging. Using a video background of abstract waves can give a modern and sophisticated feel to a Facebook page, making it stand out from the typical static image backgrounds. Additionally, it can be a great way to incorporate brand colors and make the page more visually engaging for visitors. This background can be particularly effective for companies or organizations related to water, ocean, or abstract art.',8,1,'{\"header_color\":\"#021604\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#121b3080\",\"lm_text_color\":\"#f3f8e0\",\"lm_hover_color\":\"#0d062d\",\"lm_hover_text_color\":\"\",\"font_name\":\"Enriqueta\",\"top_bg\":\"#14112d\",\"top_text\":\"#d2cbc4\"}','abstract/themes/105-abstract_waves_bg.mp4','abstract/themes/105-abstract_waves_bg_thumb.webm','abstract/themes/105-abstract_waves.webp','abstract/themes/105-abstract_waves_screenshot.webp',563,'[0,0,0,0,1]',5,'2024-09-16 13:09:21','2023-01-25 14:24:47','2024-09-16 09:09:21'),(12,'Sunset on the beach','A sunset on the beach can make an incredibly peaceful and serene background for a Facebook page. The background can feature a beautiful sunset over the ocean, with the warm colors of the setting sun reflecting on the water. The background can also show the beach with people enjoying the sunset, such as couples walking hand in hand, kids playing in the sand, or someone sitting on a beach chair watching the sunset. The background can also show the seagulls flying above the water, which can add a sense of movement and life to the image. This background can create a sense of tranquility and relaxation that can appeal to visitors, making the Facebook page stand out.',1,0,'{\"header_color\":\"#333638\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#1f0d1880\",\"lm_text_color\":\"#d3ecca\",\"lm_hover_color\":\"#190817\",\"lm_hover_text_color\":\"\",\"font_name\":\"Mali\",\"top_bg\":\"#c2d5d380\",\"top_text\":\"#3a010e\"}','travel/themes/111-sunset_on_the_beach_bg.webp','','travel/themes/111-sunset_on_the_beach.webp','travel/themes/111-sunset_on_the_beach_screenshot.webp',370,'[0,0,0,1,1]',4.5,'2024-09-18 19:03:57','2023-01-25 14:30:10','2024-09-18 15:03:57'),(13,'Coral reef','A coral reef can make an incredibly vibrant and beautiful background for a Facebook page. The background can feature a coral reef teeming with life, with a variety of colorful fish swimming among the coral. The background can also show the different types of coral, such as staghorn, brain coral, and fan coral, each with its unique shape and color. The background can also include other marine life like sea turtle, starfish, and sea urchins, which can add a sense of movement and life to the image. This background can create a sense of wonder and awe, appealing to visitors and making the Facebook page stand out.',12,0,'{\"header_color\":\"#d2c9ea\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#c4dbec\",\"lm_text_color\":\"#03322b\",\"lm_hover_color\":\"#c7e6c6\",\"lm_hover_text_color\":\"\",\"font_name\":\"Noto Sans Tamil\",\"top_bg\":\"#d8eef8\",\"top_text\":\"#1f332d\"}','nature/themes/786-coral_reef_bg.webp','','nature/themes/786-coral_reef.webp','nature/themes/786-coral_reef_screenshot.webp',307,'[0,0,0,0,1]',5,'2024-09-13 18:21:22','2023-01-25 14:34:36','2024-09-13 14:21:22'),(14,'Water Caustics','Water caustics are the patterns of light that are created when light is refracted, reflected, and scattered by the water. These patterns can be seen as shimmering light on the surface of the water, and can be created by sunlight or other light sources. The video background can feature different types of water, such as a swimming pool, a lake, or an ocean, and can show the caustics in motion, creating a mesmerizing and abstract effect. The video can also include subtle animations, such as the caustics changing direction, or the light source moving, to keep the background interesting and engaging. Using a video background with water caustics can give a modern and sophisticated feel to a Facebook page, making it stand out from the typical static image backgrounds.',12,1,'{\"header_color\":\"#befaef\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#c9dace80\",\"lm_text_color\":\"#112f0a\",\"lm_hover_color\":\"#e8d1e2\",\"lm_hover_text_color\":\"\",\"font_name\":\"Fraunces\",\"top_bg\":\"#c1dff780\",\"top_text\":\"#191f0c\"}','nature/themes/142-water_caustics_bg.mp4','nature/themes/142-water_caustics_bg_thumb.webm','nature/themes/142-water_caustics.webp','nature/themes/142-water_caustics_screenshot.webp',269,'[0,0,1,0,0]',3,'2024-09-19 01:01:14','2023-01-25 14:39:44','2024-09-18 21:01:14'),(15,'Old wood texture','Old wood texture refers to the visual and tactile qualities of wood surfaces that have been aged for a long time. It is characterized by a weathered and worn appearance, with a patina that has been formed by years of exposure to the elements. The texture can be rough, uneven and can have a lot of knots and cracks, giving it a rustic and vintage look. The color of the wood can also change over time, becoming a silver grey or dark brown. Old wood texture can add a sense of history and character to a piece of furniture, architectural element, or any other surface that it is applied to. It can create a sense of warmth and naturalness in a room and can be used to add a vintage or rustic feel to a space.',22,0,'{\"header_color\":\"#21251e\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#2e2d2980\",\"lm_text_color\":\"#fbd6dd\",\"lm_hover_color\":\"#130914\",\"lm_hover_text_color\":\"\",\"font_name\":\"Noto Serif NP Hmong\",\"top_bg\":\"#071019\",\"top_text\":\"#ebeedb\"}','textures/themes/141-old_wood_texture_bg.webp','','textures/themes/141-old_wood_texture.webp','textures/themes/141-old_wood_texture_screenshot.webp',186,'[0,0,0,0,0]',0,'2024-09-13 10:04:25','2023-01-25 14:46:38','2024-09-13 06:04:25'),(16,'Star Wars','Star Wars is a beloved and iconic science fiction franchise created by George Lucas. It began with the original film, \"Star Wars\" (later retitled \"Star Wars: Episode IV  A New Hope\"), which was released in 1977. The franchise has since grown to include several sequels and prequels, as well as spin-off films, TV shows, and novels. The Star Wars universe is set in a galaxy far, far away and follows the adventures of various characters, including Jedi knights, Sith lords, and smugglers of the Rebellion against the evil Galactic Empire. The franchise is known for its epic space battles, iconic characters, and groundbreaking special effects. Star Wars has a vast and dedicated fan base and has had a significant cultural impact, inspiring countless movies, TV shows, and other forms of media. The franchise is also known for its merchandise, action figures, and video games. The latest movie of the Star Wars franchise is \"Star Wars: The Rise of Skywalker\" which was released in 2019 and the next one is scheduled to release in 2022 which is a standalone film focusing on the character Lando Calrissian.',17,0,'{\"header_color\":\"#d1d2df\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#eff2ee80\",\"lm_text_color\":\"#0d031a\",\"lm_hover_color\":\"#fddff3\",\"lm_hover_text_color\":\"\",\"font_name\":\"Noto Serif Grantha\",\"top_bg\":\"#acbab380\",\"top_text\":\"#5e6156\"}','movies/themes/678-star_wars_bg.webp','','movies/themes/678-star_wars.webp','movies/themes/678-star_wars_screenshot.webp',241,'[0,0,0,0,0]',0,'2024-09-16 13:09:20','2023-01-25 14:50:39','2024-09-16 09:09:20'),(17,'USA flag','The United States flag, also known as the American flag, is a symbol of the country\'s national identity and unity. The flag is typically composed of thirteen horizontal stripes of red and white, with a blue field in the upper left corner containing fifty white, five-pointed stars. The stripes represent the original thirteen colonies that declared independence from Great Britain and formed the United States, while the stars represent the 50 states of the Union. The design of the flag has evolved over the years, with the number of stars and stripes being adjusted to reflect the addition of new states to the Union. The flag is considered a powerful symbol of freedom, democracy, and national pride, and is prominently displayed at government buildings, schools, and other public spaces throughout the United States. It is also commonly displayed on holidays such as Independence Day and Memorial Day, and is often flown at half-mast to honor those who have died in service to the country. The flag is also used as a symbol of national identity in sports and other activities.',29,1,'{\"header_color\":\"#2c2035\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#1d121780\",\"lm_text_color\":\"#e0dddc\",\"lm_hover_color\":\"#301e39\",\"lm_hover_text_color\":\"\",\"font_name\":\"Merriweather\",\"top_bg\":\"#0b2434\",\"top_text\":\"#bee0ef\"}','flags/themes/265-usa_flag_bg.mp4','flags/themes/265-usa_flag_bg_thumb.webm','flags/themes/265-usa_flag.webp','flags/themes/265-usa_flag_screenshot.webp',261,'[0,0,0,0,0]',0,'2024-09-14 01:28:09','2023-01-25 14:55:19','2024-09-13 21:28:09'),(18,'Beautiful tree','The background can feature a large tree with lush green leaves and branches, standing tall on a vast field of green grass. The background can also show the tree in different seasons, such as the fall, with the leaves changing colors, or in the spring, with new leaves and flowers blooming. The background can also include other elements such as a blue sky, fluffy clouds, or a small stream flowing nearby, which can add a sense of life and movement to the image. A beautiful tree on a field can make an incredibly serene and natural background for a Facebook page.',12,0,'{\"header_color\":\"#1b1f13\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#10150f80\",\"lm_text_color\":\"#e2fced\",\"lm_hover_color\":\"#212f2e\",\"lm_hover_text_color\":\"\",\"font_name\":\"Pangolin\",\"top_bg\":\"#cae7c8\",\"top_text\":\"#1b0102\"}','nature/themes/624-beautiful_tree_bg.webp','','nature/themes/624-beautiful_tree.webp','nature/themes/624-beautiful_tree_screenshot.webp',267,'[0,0,0,0,0]',0,'2024-09-13 08:41:13','2023-01-25 15:00:55','2024-09-13 04:41:13'),(19,'Dollar bills','A background featuring dollar bills can add a unique and visually interesting look to a Facebook page. It can symbolize wealth and success. The background can feature an image of a large stack of dollar bills, with the denomination and design of the bills adding to the visual interest.',45,0,'{\"header_color\":\"#302f28\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#1d082180\",\"lm_text_color\":\"#f9cfc2\",\"lm_hover_color\":\"#3e1737\",