5 15:33:59','2024-09-10 23:33:18'),(24,'Tropical cave on the beach','These caves are formed by the erosion of the cliffs, and can be found in regions with a warm and humid climate, such as the Caribbean or Hawaii. A tropical cave on the beach can provide a unique and secluded setting for swimming, snorkeling, or exploring. The cave can be filled with crystal clear water and host a variety of marine life, such as colorful fish, corals, and sea turtles. The cave can also have openings that allow sunlight to filter in, illuminating the cave and creating a magical and enchanted atmosphere. The combination of lush vegetation and crystal clear water can make the cave a unique and stunning natural wonder. Additionally, it can be a great place to take pictures and create memories, making it a popular destination for tourists and adventurers.',1,0,'{\"header_color\":\"#0e3033\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#14363e80\",\"lm_text_color\":\"#efe7ef\",\"lm_hover_color\":\"#241e09\",\"lm_hover_text_color\":\"\",\"font_name\":\"Proza Libre\",\"top_bg\":\"#46404a\",\"top_text\":\"#9c94aa\"}','travel/themes/707-tropical_cave_on_the_beach_bg.webp','','travel/themes/707-tropical_cave_on_the_beach.webp','travel/themes/707-tropical_cave_on_the_beach_screenshot.webp',240,'[0,0,0,0,0]',0,'2024-09-13 10:04:42','2023-01-25 15:38:58','2024-09-13 06:04:42'),(25,'Cyberpunk 2077','Night City, the setting for the video game \"Cyberpunk 2077,\" is a sprawling metropolis located in California in the year 2077. The atmosphere of the city is dark, gritty, and dangerous, with a high level of poverty and crime. The city is controlled by powerful corporations, and the streets are filled with gangs and other dangerous groups. The advanced technology present in the city, including cybernetic enhancements and advanced AI, only adds to the