,'New York City is the most populous city in the United States and one of the most famous and iconic cities in the world. It is located on the East Coast of the country, at the mouth of the Hudson River in the state of New York. The city is made up of five boroughs: Brooklyn, Queens, Manhattan, the Bronx, and Staten Island. It is a major center for finance, culture, research, and entertainment. It is home to some of the world\'s most famous landmarks and attractions, such as the Statue of Liberty, Central Park, Times Square, and the Empire State Building. The city is also known for its diverse population, world-renowned restaurants, and vibrant nightlife. It is one of the most visited tourist destination in the world.',31,0,'{\"header_color\":\"#08000e\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#100a2080\",\"lm_text_color\":\"#f3f9cf\",\"lm_hover_color\":\"#183107\",\"lm_hover_text_color\":\"\",\"font_name\":\"Jost\",\"top_bg\":\"#1d2d3a\",\"top_text\":\"#dbdfd9\"}','cities/themes/365-new_york_city_bg.webp','','cities/themes/365-new_york_city.webp','cities/themes/365-new_york_city_screenshot.webp',481,'[0,0,0,0,1]',5,'2024-09-16 16:19:02','2023-01-26 21:38:50','2024-09-16 12:19:02'),(28,'The Matrix','The Matrix is a 1999 science fiction action film directed by the Wachowskis. The film stars Keanu Reeves as Neo, a hacker who discovers that the world as he knows it is actually a simulated reality created by sentient machines to pacify and subdue the human population, while their bodies are used as an energy source. Neo is rescued by a group of rebels, led by Morpheus (Laurence Fishburne) and Trinity (Carrie-Anne Moss), who help him to understand his role as \"The One,\" a messianic figure who is prophesied to bring an end to the Matrix and free humanity. The Matrix was a critical and commercial success and has since become a cultural phenomenon. A sequel, The Matrix Reloaded, was released in 2003, followed by The Matrix Revolutions in 2003.',17,0,'{\"header_color\":\"#26190b\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#0d360e80\",\"lm_text_color\":\"#eaf5f5\",\"lm_hover_color\":\"#0f0738\",\"lm_hover_text_color\":\"\",\"font_name\":\"Encode Sans\",\"top_bg\":\"#00310c\",\"top_text\":\"#e7e2eb\"}','movies/themes/306-the_matrix_bg.webp','','movies/themes/306-the_matrix.webp','movies/themes/306-the_matrix_screenshot.webp',464,'[0,0,0,0,0]',0,'2024-09-13 10:04:44','2023-01-26 21:43:56','2024-09-13 06:04:44'),(29,'Smooth Purple and Green Calm Motion','This videobackground that is specifically designed to be used as a background on social media platforms like Facebook. These videos are typically characterized by smooth, slow-moving imagery that is meant to evoke a sense of tranquility and relaxation. They are often used by businesses and individuals to enhance the visual appeal of their social media posts, and can be used for a wide range of purposes, such as promoting products or services, sharing personal updates, or simply creating a more visually engaging social media presence. They can be made in various colors, including purple and green, to create a specific ambiance.',8,1,'{\"header_color\":\"#dddfe4\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#d0d2c780\",\"lm_text_color\":\"#101129\",\"lm_hover_color\":\"#eef4f3\",\"lm_hover_text_color\":\"\",\"font_name\":\"Literata\",\"top_bg\":\"#e2c8d580\",\"top_text\":\"#3b1b08\"}','abstract/themes/449-smooth_purple_and_green_calm_motion_bg.mp4','abstract/themes/449-smooth_purple_and_green_calm_motion_bg_thumb.webm','abstrac