uably the most widely used operating system in the world. And at the same time, more than 3% of users still use earlier versions of the platform, such as Windows 7 and Vista. Despite modern trends in design, there are still a lot of fans of the same, voluminous, glossy design. Experience nostalgia by styling the interface with our Windows Vista YouTube skin. We offer not to argue about tastes, but simply choose what you like!','{\"playbar_background\":\"background: linear-gradient(90deg, rgba(6,162,199,0) 21%, rgba(6,155,199,0.6697180825455182) 50%, rgba(6,162,199,0) 81%);\",\"ytpswatchbackgroundcolor\":\"background: linear-gradient(90deg, rgba(0,206,255,1) 0%, rgba(1,211,255,1) 84%, rgba(255,255,255,1) 100%);\",\"ytpprogresslist\":\"\",\"ytpscrubberbutton\":\"height: 22px !important; width: 21px; border-radius: 6.5px;                         \",\"ytpscrubbercontainer\":\"top: -9px !important; left: -11px; z-index: 43;                         \",\"ytpvolumesliderhandlebefore\":\"left: -57px; background: #01d3ff;\",\"ytpvolumesliderhandleafter\":\"left: 9px;\",\"ytpvolumesliderhandle\":\"width: 17px !important; height: 17px !important; border-radius: 6px !important; margin-top: -9px !important;                         \",\"ytpbuttonariapressedafter\":\"background: #ffffff00\",\"ytpgradientbottom\":\"height: 180px !important;                         \",\"ytptimedisplaysilver\":\"color:#a9ffff; fill:#a9ffff;                         \",\"ytptimedisplayred\":\"color:red;                         \",\"leftbottom\":\"width: 100px; height: 100px; position: absolute; bottom: 0; left: 0; pointer-events: none; z-index: 24; background-size: contain;                                                 \",\"lefttop\":\"width: 100px; height: 100px; position: absolute; top:0; left: 0; pointer-events: none; z-index: 24; background-size: contain;                         \",\"rightbottom\":\"width: 100px; height: 100px; position: absolute; bottom: 0; right: 0; pointer-events: none; z-index