  `p_file` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `offsetX` smallint unsigned NOT NULL,
  `offsetY` smallint unsigned NOT NULL,
  `offsetX_p` smallint unsigned NOT NULL,
  `offsetY_p` smallint unsigned NOT NULL,
  `top` int unsigned DEFAULT '0',
  `cat` bigint unsigned NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `schedule` date NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`),
  KEY `id_2` (`id`),
  KEY `top` (`top`),
  KEY `cat` (`cat`),
  KEY `schedule` (`schedule`)
) ENGINE=InnoDB AUTO_INCREMENT=2086 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
